import Men from "./men";

const Navbar = () => {
  return (
    <nav className="w-full absolute top-0 p-5 border ">
      <div className="flex relative  items-center justify-between">
        <div className=" font-bold text-2xl text-Black">
          <Link to={URLS.collections.url}>sneakers</Link>
        </div>
        <div className=" text-DarkGrayishBlue space-x-6">
          <Link to={URLS.collections.url} className=" hover:">Collections</Link>
          <Link to={URLS.men.url}>Men</Link>
          <Link to={URLS.women.url}>Women </Link>
          <Link t0={URLS.about.url}>About</Link>
          <Link to={URLS.contact.url}>Contact</Link>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
